import React from 'react'

export default function TestPage() {

    const named_array =[
        {
            name:"Zeeshan",
            email:"zeeshna@"
        },

        {
            name: "maida",
            email:"maida@"
        }
    ]


    const Users = () => {
        const data = [
          { id: 1, name: "John Doe" },
          { id: 2, name: "Victor Wayne" },
          { id: 3, name: "Jane Doe" },
        ];
      
        return (
          <div className="users">
            {data.map((user) => (
              <div className="user">{user}</div>
            ))}
          </div>
        );
      };


}
